import './App.css';
import React from "react";
import Login from "./login.js";
import { HashRouter as Router, Route, Routes } from "react-router-dom";
import Menu from './menu';

function App() {
  return (
    <Router>
      <Routes>
        <Route exact path="/" component={Menu} />
        <Route path="/about" component={Login} />
      </Routes>
    </Router>
  );
}

export default App;
